  aRichTextSlot_30:
    type: aRichText
    variant: null
    value: "<h3>Welcome to aSandbox, a sample site built using <a href=\"http://www.apostrophenow.com\" rel=\"external\">Apostrophe</a>.</h3> <p>You can edit this text by clicking the Edit button. You can also add additional slots to this area, such as video and slideshow slots, via the Add Slot button.</p>\n"
  aRichTextSlot_31:
    type: aRichText
    variant: null
    value: "<h3>Bienvenue dans le aSandbox, un exemple de site réalisé en utilisant  <a href=\"http://www.apostrophenow.com\" rel=\"external\">Apostrophe</a>.</h3>  <p>Vous pouvez éditer ce texte en cliquant sur le bouton &laquo;&nbsp;Editer&nbsp;&raquo;. Vous pouvez  également ajouter des emplacements supplémentaires à cette zone, tel qu'un  emplacement vidéo ou un emplacement diaporama, en utilisant le bouton &laquo;&nbsp;Ajouter  un emplacement&nbsp;&raquo;.</p>\n"
  aRichTextSlot_32:
    type: aRichText
    variant: null
    value: "<h3>For more information or help with <a href=\"http://www.apostrophenow.com\" rel=\"external\">Apostrophe</a>, contact <a href=\"mailto:apostrophe@punkave.com\">apostrophe@punkave.com</a></h3>\n"
  aRichTextSlot_33:
    type: aRichText
    variant: null
    value: "<h3>Pour plus d'informations ou obtenir de l'aide au sujet  d'<a href=\"http://www.apostrophenow.com\" rel=\"external\">Apostrophe</a>,  contactez <a href=\"mailto:apostrophe@punkave.com\">apostrophe@punkave.com</a></h3>\n"
  aRichTextSlot_34:
    type: aRichText
    variant: null
    value: "<h3> Oops! You do not have anything suitable in your media library.<br />Do you want to <a href=\"#upload-images\" class=\"a-add-media-toggle\">add some media?</a></h3>\n"
  aRichTextSlot_35:
    type: aRichText
    variant: null
    value: "<h2>Error 404 &mdash; The page you are looking for could not be found.</h2><h3><a href=\"/\">Go Home.</a></h3>\n"
  aRichTextSlot_36:
    type: aRichText
    variant: null
    value: "<h3>Learn more about <a href=\"http://www.apostrophenow.com\" rel=\"external\">Apostrophe</a>.</h3> It is open source, robust, &amp; super easy to use!\n"
  aRichTextSlot_37:
    type: aRichText
    variant: null
    value: "<h3>Découvrez <a href=\"http://www.apostrophenow.com\" rel=\"external\">Apostrophe</a>.</h3>  Une solution open source, robuste et extrêmement simple à utiliser!\n"
  aRichTextSlot_38:
    type: aRichText
    variant: null
    value: "<h3>\n	Je suis NI</h3>"
  aRichTextSlot_39:
    type: aRichText
    variant: null
    value: "<p>\n	Ent&ecirc;te des niouzes.</p>"
  aRichTextSlot_40:
    type: aRichText
    variant: null
    value: "<p>\n	Samedi soir, mangez du pain !</p>"
  aRichTextSlot_41:
    type: aRichText
    variant: null
    value: "<p>\n	tul&eacute; !</p>"
  aRichTextSlot_42:
    type: aRichText
    variant: null
    value: "<h3>\n	Premi&egrave;re News</h3>\n<p>\n	Mangez du Pain !</p>"
  aRichTextSlot_43:
    type: aRichText
    variant: null
    value: "<h3>\n	Les musiciens</h3>\n<p>\n	They are the knights who say ... <strong>Ni</strong> !</p>"
  aRichTextSlot_44:
    type: aRichText
    variant: null
    value: "<h3>\n	Les musiciens</h3>\n<p>\n	They are the knights who say ... <strong>Ni</strong> !</p>"
  aRichTextSlot_47:
    type: aRichText
    variant: null
    value: "<p>\n	#FF3399 et dur labeur !</p>\n<p>\n	(vivement les textes en couleur !)</p>"
  aRichTextSlot_54:
    type: aRichText
    variant: null
    value: "<p>\n	Nous allons d&eacute;fibruller de la patoise, cadine !</p>\n<p>\n	On y va tant&ocirc;t, alors radine !</p>"
  aRichTextSlot_56:
    type: aRichText
    variant: null
    value: "<p>\n	Nous allons d&eacute;fibruller de la patoise, cadine !</p>\n<p>\n	On y va tant&ocirc;t, alors radine !</p>\n<br />\n<blockquote>\n	<p>\n		<em>Et kuala, t'as un probl&egrave;me ?</em></p>\n</blockquote>"
  aRichTextSlot_60:
    type: aRichText
    variant: null
    value: "<p>\n	TWALA !</p>\n<p>\n	ACH&Egrave;TE LE NI C&Eacute;D&Eacute;V&Eacute;D&Eacute; !</p>"
  aRichTextSlot_61:
    type: aRichText
    variant: null
    value: "<p>\n	Nous sommes les chevaliers qui disent... <strong>Ni</strong> !</p>"
  aRichTextSlot_63:
    type: aRichText
    variant: null
    value: "\n<p>\n	D'abord, ni est ni. Ensuite, ni n'est ni diatrib(a), ni JMPZ, mais ni plus ni moins qu'une &eacute;manation des deux, r&eacute;unis pour une musique qui n'a esth&eacute;tiquement ni dieu ni ma&icirc;tre, ni foi ni loi, ni queue ni t&ecirc;te. Ni chant, ou presque.</p>\n<p>\n	En fait, le r&eacute;sultat n'est ni r&eacute;ellement hard-core, ni franchement jazz &eacute;lectrique. Ni R'n'B. C'est compliqu&eacute;. Oui c'est compliqu&eacute;, alors n'&eacute;piloguons pas sur le genre musical que fait ni. A quoi bon? Enfin, parions que loin de vous faire ni chaud ni froid, ces quatre l&agrave; au contraire...</p>"
  aRichTextSlot_67:
    type: aRichText
    variant: null
    value: "<p>\n	tesdt</p>"
  aRichTextSlot_82:
    type: aRichText
    variant: null
    value: "\n<div>\n	<em>On va d&eacute;fibruller de la b&eacute;casse &agrave; la calouette, donc radine !</em></div>"
  aRichTextSlot_94:
    type: aRichText
    variant: null
    value: "\n<p>\n	D'abord, ni est ni. Ensuite, ni n'est ni diatrib(a), ni JMPZ, mais ni plus ni moins qu'une &eacute;manation des deux, r&eacute;unis pour une musique qui n'a esth&eacute;tiquement ni dieu ni ma&icirc;tre, ni foi ni loi, ni queue ni t&ecirc;te. Ni chant, ou presque.</p>\n<p>\n	En fait, le r&eacute;sultat n'est ni r&eacute;ellement hard-core, ni franchement jazz &eacute;lectrique. Ni R'n'B. C'est compliqu&eacute;. Oui c'est compliqu&eacute;, alors n'&eacute;piloguons pas sur le genre musical que fait ni. A quoi bon? Enfin, parions que loin de vous faire ni chaud ni froid, ces quatre l&agrave; au contraire...</p>"
  aRichTextSlot_97:
    type: aRichText
    variant: null
    value: "<p>\n	D'abord, ni est ni. Ensuite, ni n'est ni diatrib(a), ni JMPZ, mais ni plus ni moins qu'une &eacute;manation des deux, r&eacute;unis pour une musique qui n'a esth&eacute;tiquement ni dieu ni ma&icirc;tre, ni foi ni loi, ni queue ni t&ecirc;te. Ni chant, ou presque.</p>\n<p>\n	En fait, le r&eacute;sultat n'est ni r&eacute;ellement hard-core, ni franchement jazz &eacute;lectrique. Ni R'n'B. <strong>C'est compliqu&eacute;.</strong> Oui c'est compliqu&eacute;, alors n'&eacute;piloguons pas sur le genre musical que fait ni. A quoi bon? Enfin, parions que loin de vous faire ni chaud ni froid, ces quatre l&agrave; au contraire...</p>"
  aRichTextSlot_98:
    type: aRichText
    variant: null
    value: "<p>\n	Voil&agrave; la liste des concerts :</p>"
  aRichTextSlot_100:
    type: aRichText
    variant: null
    value: "<p>\n	We are the knights who say... <strong>Ni !</strong></p>\n"
  aRichTextSlot_101:
    type: aRichText
    variant: null
    value: "<h3>\n	The band</h3>\n<p>\n	They are the knights who say ... <strong>Ni</strong> !</p>"
